import React from "react";
import './i_itemstyle.css'

import { useState } from "react";
import Expand from "../expand";



export default function Item  ({
    id , 
    title , 
    amount , 
    date , 
    Category , 
    note , 
    deleteItem  }) {
     
   const [show , setshow] = useState(false) ;

    return(
        <div className="item">
<div className="icon">
   
</div>
<div className="content">
    <h5>{title}</h5>
    <p>{amount}</p>


<button className="expand" onClick={()=>{ setshow(!show)}}></button>
{show && <div className="details"><p><i/>{title}</p>
<p><i/>{amount}</p>
<div><i/>{date}</div>
<p><i/>{note}</p>

<button onClick={()=>{ setshow(!show)}}></button></div>}

<button className="del-but" onClick={()=>deleteItem(id)}><i class="fa-light fa-trash"></i></button>   
        </div>
     
    </div>

    )
}
